script: |
  super -f text -I q12203.spq | sort > q12203.out

inputs:
  - name: q12203.spq
    data: |
      SELECT + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + col1 IN ( - + col2, 16 * col2 * col0 + - col0 );
  - name: tab0

outputs:
  - name: q12203.out
    data: |
      1
      21
      81
